import './todo.css';
import RightNavBar from '../rightsidebar/Navbarright';
const Home = () => {
    return (
        <div className="container">
            <div className="section-nav" >
             
               
               
                      
                      <div className="section-heading">
                              <h2>Section</h2>
                      </div>
                       <div className="wallet-data">
                            <img src="icons/Wallet.png" alt="" />
                            <div className="w-content">0.2$XYZ</div>
                            <div className="tier">Tier 1</div>
                       </div>
            
                   
            </div>
            <div className="main">
      
                {/* <div className="todo-list" >
                              
                </div>
                 <div className="right-side-bar" style={{backgroundColor:"pink", transition:"0.3s"}}>
                        
                              
                </div> */}
         
                  {/* <RightNavBar/> */}
         
         </div>
        </div>
      );
}
 
export default Home;
